import React from "react";
import mainBackground from "./mainImages/background.png";
import NavBar from "./Nav-Bar.js";
import Skills from "./Skills.js"
import "./App.css";

export default function Home() {
  return (
    <div className="App">
      <header className="App-header" />
      <NavBar />
      <body>
        <container className="Home-Page">
          <img
            className="Background"
            src={mainBackground}
            alt="Tokyo Cityscape Background"
          />
          <div className="Intro-Writing">
            <h1>Jack Painter</h1>
            <h2>Full-Stack Developer</h2>
            <h2>(London)</h2>
            <button>Contact me!</button>
          </div>
        </container>
        <About />
        <Skills />
      </body>
    </div>
  );
}

function About() {
  return (
    <div className="About-Container">
      <div>My name is Jack Painter and I am a enthusiastic and passionate junior full-stack developer. After more than 4 years of working on the sales side of IT, I decided enough was enough and made the decision to drop it all and become a developer.</div>
      <div>Currently on an intensive full-stack development course with Kodiri where I am using JavaScript, React, Node, HTML and CSS to develop a netflix clone and a soon to be disclosed group project.</div>
      <div>When I am not coding your find me taking photos(any tips/advice would be very welcome), listening to my vinyls, attending meetups and nervously watching Lando Norris(F1) or Arsenal(football).</div>
    </div>
  );
}
